class Solution {
    func countInterestingSubarrays(_ nums: [Int], _ modulo: Int, _ k: Int) -> Int {
        var count = 0
        var prefixCounts = [Int: Int]()
        var currentCount = 0

        prefixCounts[0] = 1 // Initialize for subarrays starting with index 0

        for num in nums {
            if num % modulo == k {
                currentCount += 1
            }
            let targetCount = (currentCount - k + modulo) % modulo
            count += prefixCounts[targetCount, default: 0]
            prefixCounts[currentCount % modulo, default: 0] += 1
        }

        return count
    }
}
